import React, { Fragment } from "react";
import "../Styles/seed.css";
import {ReactComponent as ChevronUpDouble} from '../assets/icons/chevron_up_double.svg';
import {ReactComponent as Close} from '../assets/icons/close.svg';
import {ReactComponent as Create} from '../assets/icons/create.svg';
import {ReactComponent as Diamond} from '../assets/icons/diamond.svg';
import {ReactComponent as Eye} from '../assets/icons/eye.svg';
import {ReactComponent as FingerPrint} from '../assets/icons/fingerprint.svg';
import {ReactComponent as Home} from '../assets/icons/home.svg';
import {ReactComponent as Link} from '../assets/icons/link.svg';
import {ReactComponent as MessageWriting} from '../assets/icons/message_writing.svg';
import {ReactComponent as PaperClip} from '../assets/icons/paperclip.svg';
import {ReactComponent as Picture} from '../assets/icons/picture.svg';
import {ReactComponent as Plus} from '../assets/icons/plus.svg';
import {ReactComponent as Rocket} from '../assets/icons/rocket.svg';
import {ReactComponent as Target} from '../assets/icons/target.svg';
import {ReactComponent as UserMaleCircle} from '../assets/icons/user_male_circle.svg';

export default function Icon(props) {
  const { className, iconsdf, iconClassName } = props;

  return (
    <Fragment><div className={` ${className} h-pr-fl-ma r-h-c b-s-b-b `}>
      <img className={` ${iconClassName } w-100 h-100  p-r m-a r-v-c p-5px `} Style="object-fit: cover;" src={` ${iconsdf} `}/>
      </div></Fragment>
  );
}
